import React from 'react'; 
import SocialItem from './SocialItem';
function Social(){
    return(
        <ul className="list-group">
           
            <SocialItem
                 p={{
                    media:'Facebook',
                    id:'facebook',
                    img:"https://cdn-icons-png.flaticon.com/128/145/145802.png",
                 }}

            />
           


           
        </ul>
    );
}

export default Social;
